import './style.css';
import Card_Movie from '../componentes/Card_Movie/index';

export default function Movies(props)
{
    //const { title, backgroundImg, starsCount, price } = props.movie;
    return (
        <div className = "filmes">            
            <h3 className="txt-filmes">Top Filmes</h3>            
            <div className="top-conteudo">
                <Card_Movie/>
            </div>

            <h3 className="txt-filmes">Filmes</h3>
            <div className="filmes-conteudo">
                <div className="filmes"></div>
                <div className="filmes"></div>
                <div className="filmes"></div>
                <div className="filmes"></div>
                <div className="filmes"></div>
                <div className="filmes"></div>
                <div className="filmes"></div>
                <div className="filmes"></div>
                <div className="filmes"></div>
                <div className="filmes"></div>
            </div>          
        </div>
    )
}
